# 获取数据
def get_count():
    hyper_pd = pd.read_csv('./dongfan_data/HYPER_FULL_ORG_东方市港区中心卫生院_MULTI.csv', header=None)
    #print(type(hyper_pd))
    # 统计 正样本 负样本
    # for index, row in hyper_pd.iterrows():
    #     #hyper_pd.append(index)
    #     print(type(row))
    #     print(row[22])

    hyper_group = hyper_pd.groupby(1)

    list_series_pos = []
    list_series_neg = []
    list_series_nor = []
    sum=0
    for hyper_coll in hyper_group:
        #print(hyper_coll)
        #print(type(hyper_coll[1]))
        list_label = []
        #print(hyper_coll[1].shape)
        for index,row in hyper_coll[1].iterrows():
            #print(row[22])
            list_label.append(row[22])
        flag = True
        for i in range(1,len(list_label)):
            if list_label[0]!=list_label[i]:
                flag = False
        if flag == True and list_label[0]==0:
            list_series_pos.append(hyper_coll[1])
            sum+=hyper_coll[1].shape[0]
        if flag == True and list_label[0]==1:
            list_series_neg.append(hyper_coll[1])
            sum += hyper_coll[1].shape[0]
        if flag == False:
            list_series_nor.append(hyper_coll[1])
            sum += hyper_coll[1].shape[0]
    #print("sum= ",sum)

    print("len pos ",len(list_series_pos))
    print("len neg ",len(list_series_neg))
    print("len nor ",len(list_series_nor))
    for i in range(0,len(list_series_pos)):
        list_series_pos[i].to_csv('./dongfan_data/HYPER_FULL_ORG_东方市港区中心卫生院_MULTI_pos.csv',mode='a',index=None,header=False)

    for i in range(0,len(list_series_neg)):
        list_series_neg[i].to_csv('./dongfan_data/HYPER_FULL_ORG_东方市港区中心卫生院_MULTI_neg.csv',mode='a',index=None,header=False)


    for i in range(0,len(list_series_nor)):
        list_series_nor[i].to_csv('./dongfan_data/HYPER_FULL_ORG_东方市港区中心卫生院_MULTI_nor.csv',mode='a',index=None,header=False)

